// import axios from 'axios'
import {REGISTER,DELETE} from './types';

const action =(type,payload) =>{
    return{type,payload}
}
export const RegisterAction =(firstName,id)=>
    action(REGISTER,
    {
    firstName,
    lastName,
    email,
    password,
    mobileNumber,
    id
}) 
export const deleteAction = id => action(DELETE, id)
